import styled from "styled-components";

interface modalProps {
  isModalOpen: boolean;
  close(): void;
  label: string;
  additional?: any;
}

const Wrapper = styled.div`
  width: 330px;
  height: 180px;
  border: 1px solid black;
  border-radius: 20px;
  z-index: 1000;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

const Modal = ({ isModalOpen, close, label, additional }: modalProps) => {
  return 
  {isModalOpen && (<Wrapper></Wrapper>)}

};

export default Modal;
